import React, { useRef, useEffect, useState, useCallback } from "react";
import mojs from "@mojs/core";
import svg from "../assets/water2.svg";
import { useGlobalActions, useGlobalState } from "../context/globalContext";
const WaterBody = ({ earthRef, position, uid, size }) => {
  const { removeWaterBodyById } = useGlobalActions();

  return (
    <div className="WaterBody" style={{ position: "absolute" }}>
      <div
        className="WaterBody"
        style={{
          position: "absolute",
          top: position.y - size / 2,
          left: position.x - size / 2,
        }}
      >
        <div
          className="WaterBody"
          // class="shake-hard shake-constant"
          //   onClick={(e) => {
          //     e.preventDefault();
          //     console.log(e);
          //     if (e.button !== 2) {
          //       removeWaterBodyById(uid);
          //     }
          //   }}
          style={{
            // position: "absolute",
            // top: position.y - size / 2,
            // left: position.x - size / 2,
            boxShadow: "inset 0 0 10px #485662",
            borderRadius: size / 2,
            backgroundColor: "#66B3FF",
            width: size,
            height: size,
          }}
        ></div>
      </div>
    </div>
  );
};

export default WaterBody;
